import React from 'react';

const FilterDropdown = ({ filter, setFilter }) => (
  <select
    value={filter}
    onChange={(e) => setFilter(e.target.value)}
    className="p-2 border rounded"
  >
    <option value="">All Categories</option>
    <option value="Compliance">Compliance Laws</option>
    <option value="Data Privacy">Data Privacy Laws</option>
    <option value="Cybercrime Consequences">Consequences for Hackers</option>
  </select>
);

export default FilterDropdown;
